import React from 'react'

const Header = () => {

    const month = ["January","February",
                    "March","April","May",
                    "June","July","August",
                    "September","October","November",
                    "December"];

    let currentMonth = month[new Date().getMonth()];

    return (
        <h1>
            {currentMonth}
        </h1>
    )
}

export default Header
